import React from "react";
import { useHistory } from "react-router-dom";

export default function PageTwo() {
  const history = useHistory();
  return (
    <React.Fragment>
      <div>
        <button onClick={() => {history.push('/')}}>Page One</button>
        <button onClick={() => {history.push('/three')}}>Page Three</button>
      </div>
    </React.Fragment>
  );
}
